import React from 'react';
import Navbar from './components/navbar/navbar';
import About from './components/content/About';
import Particles from 'react-particles-js';
import {makeStyles} from '@material-ui/core/styles';
import Projects from './components/projects/projects';

const useStyles = makeStyles({
    particlesCanva: {
      position:'absolute',
      opacity: '0.3'
    }
  })

const Home = () => {
    const classes = useStyles();
    return (
       <div>
           <Navbar/>
            <About/>
            <Particles
            canvasClassName={classes.particlesCanva}
            params={{
                particles: {
                number:{
                    value: 50,
                    density: {
                    enable: true,
                    value_area: 900
                    }
                },
                line_linked: {
                    shadow: {
                    enable: true,
                    color: "#3CA9D1",
                    blur: 5
                    }
                },
                shape: {
                    type: 'circle',
                    stroke: {
                    width: 1,
                    color: '#d35400'
                    }
                },
                size: {
                    value: 8,
                    random: true,
                    anim: {
                    enable: true,
                    speed: 5,
                    size_min: 0.1,
                    sync: true
                    }
                },
                opacity: {
                    value: 1,
                    random: true,
                    anim: {
                    enable: true,
                    speed: 1,
                    opacity_min: 0.1,
                    sync: true
                    }
                }
                }
            }
            }
      /> 
       </div> 

    )
}

export default Home;
